import {Route} from 'react-router-dom'
import Product from './component/Product';
import Welcome from './component/Welcome';
function App() {
  return (
    <div>

      <Route path='/welcome'>
          <Welcome/>
      </Route>
      <Route path='/product'>
          <Product/>
      </Route>
      <h2>Let's get started!</h2>
    </div>
  );
}

export default App;
